  /// /// The signal that establishes a Topic is alive comes from the ROS rmw layer.
  static const int RMW_QOS_POLICY_LIVELINESS_AUTOMATIC = 1;
  static const int RMW_QOS_POLICY_LIVELINESS_MANUAL_BY_NODE = 2;

